import { useEffect, useState } from "react";

// import React from "react";
export default function TripList() {
  const [trips, setTrips] = useState([]);
  useEffect(() => {
    fetch(" http://localhost:3001/trips")
      .then((response) => {
        return response.json();
      })
      .then((json) => {
        console.log(json);
        setTrips(json);
      });
  }, []);

  return (
    <div>
      <h2>TripList</h2>
    </div>
  );
}
